                new Realisation {Id = 786, IdMesure =  162     , IdActivite = 533  ,  Situation ="عمل متواصل", TauxRealisation= 50, Nom="'- لمواكبة دخول القانون رقم 19-12 بتحديد شروط الشغل و التشغيل المتعلقة بالعاملات و العمال المنزليين حيز التنفيذ، تم انجاز حملتين تحسيسيتين لفائدة الفاعلين في هذا المجال في كل من فاس و مراكش، و تنظيم يوم دراسي حضرته جميع القطاعات المعنية بما فيها وزارة العدل و رئاسة النيابة العامة من اجل تعزيز التنسيق لضمان حسن احترام مقتضيات القانون السالف الذكر و نصوصه التطبيقية. -تم ابرام 19 اتفاقية شراكة مع الجمعيات العاملة في مجال محاربة تشغيل وحماية حقوق المرأة في العمل برسم سنة 2019. بهدف القيام خاصة بأنشطة وبرامج تحسيسية و توعوية بمقتضيات مدونة الشغل ذات الصلة بالحقوق الشغلية للفئات الخاصة.", Annee = 2020},
                new Realisation {Id = 787, IdMesure =  163     , IdActivite = 534  ,  Situation ="منجز", TauxRealisation= 100, Nom="'- تم في اطار الرفع من القدرات اطر وزارة الشغل و الادماج المهني برسم سنتي 2018 و 2019 تنظيم دورات تكوينية بهذف تملك اليات الاشتغال و الاندماج في التخصص الميداني لفائدة :* 28 متصرفا بالوزارة تم ادماجهم في جهاز تفتيش الشغل خلال سنة 2018.* 32 مفتشا للشغل تم توظيفهم سنتي 2018 و 2019. و قد همت هذه الدورات تكوينية باضافة الى كيفية تدبير زيارات التفتيش، و اليات حل نزاعات الشغل الجماعية و الفرضية ، و النهوض بالمفاوضة الجماعية و ابرام اتفاقيات العمل الدولية المصادق عليها من طرف بلادنا. - تم تنظيم 18 دورة تكوينة جهوية لفائدة جميع اعوان تفتيش الشغل حول مقتضيات القانون 19,12 ونصوصه التطبيقية. - تم خلال سنتي 2018-2019. تنظيم ورشة وعدة لقاءات ثلاثية الاطراف بتعاون مع منظمة العمل الدولية حول الاهداف الاساسية و النتائج المتوخاة من برنامج النهوض بالعمل الائق، و الذي تم من خلالها اعتماد الاطار التصويري للعجز الذي يعرفه العمل اللائق بالمغرب، وكذا تحديد أولويات البرنامج  على الصعيد الوطني، ويهدف هذا البرنامج الى تحسين ولوج العمل اللائق و المنتج من لدن المراة و الرجل على حد سواء، في اطار من الحرية و الانصاف و الامن و الكرامة الانسانية.", Annee = 2020},
